import React from 'react';
import '../index.css';
import HoverImage from "react-hover-image";

function Card(props) {


        return (
        <>
                        <section className="hero-section">


                                <div className="main1" >
                                        <a href={props.link} target='_blank'>
                                                <div class="polaroid"  >

                                                        <HoverImage src={props.imgsrc} hoverSrc={props.imgsrc2} alt="Norway" style={{ width: '100%' }} />

                                                        <div class="container">

                                                                <h4>Brand :{props.sname}</h4>
                                                                <h4>Title: {props.title}</h4>

                                                                <div class="product-price1">
                                                                        {props.price}
                                                                        <span>{props.sale_price}</span>
                                                                </div>

                                                        </div>
                                                </div>
                                        </a>
                                </div>
                                </section>
        </>)
}

export default Card;
